ul {
  overflow-y: auto;
  padding-left: .5rem;
  margin-top: -.8rem;
  span.active {
    i {
      border-radius: 2px;
      border-color: #4a4a48;
      background-color: #4a4a48;
      color: #fff;
      transition: all .3s;
    }
  }
  i {
    font-size: 1.5rem;
    border: 1px solid #f1f1f1;
    padding: .2rem;
    margin: .3rem;
    cursor: pointer;
    &:hover {
      border-radius: 2px;
      border-color: #4a4a48;
      background-color: #4a4a48;
      color: #fff;
      transition: all .3s;
    }
  }
  li {
    list-style: none;
    float: left;
    width: 40px;
    text-align: center;
    cursor: pointer;
    color: #555;
    transition: color .3s ease-in-out,background-color .3s ease-in-out;
    position: relative;
    margin: 3px 0;
    border-radius: 4px;
    background-color: #fff;
    overflow: hidden;
    padding: 10px 0 0;
  }
}
